import React from 'react'
import Grid from '@mui/material/Grid'
import Container from '@mui/material/Container'

const Personajes = ({personaje = []}) =>{

    return(

    <div >
                  { personaje.map(pers => {
                      return <div >
                          <Container maxWidth="xs">
                            
                          </Container>
                              <Grid item xs = {4}>
                                <img src={pers.image} alt="" />   
                              </Grid>
                      
                     </div>
                  })
                  }
    </div>
)
}

export default Personajes
